import Cards from "./cards";
import "./styles/proyectos.css"
function Proyects() {
    return (
      
      <div id="proyectos"className="proyectos">
      <div className="tituloP">
      Proyectos
      </div>
      <div className="container">
       <Cards/>
      </div>
      </div>
    );
  }
  
  export default Proyects;
